import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './login/login';
import Sidi from './sidi';
import Jwadou from './jwadou';


function App() {
  // Define some dummy user information


  return (
    <Router>

    <div className="App">
      <Router>
      <Routes>
      <Route path='/' element={ <Login/>}/>
      <Route path='/jwadou' element={ <Jwadou/>}/>
      <Route path='/sidi' element={<Sidi/>}/>
        {/* Autres routes ici */}
      </Routes>
    </Router>
    </div>
    </Router>
  );
}

export default App;
